import React from 'react';

const Header = () => {
    return (
        <header className="header">
            <img src="https://www.google.com/search?q=logo&sxsrf=ALeKk03cV9FshhLStQMq2qfCXS58psoVKg:1584044485998&source=lnms&tbm=isch&sa=X&ved=2ahUKEwizv5XH4ZXoAhUyx4sKHYuuC1IQ_AUoAXoECAwQAw#imgrc=QAbJP4GwmKaRLM" alt=""></img>
        </header>
    );
}

export default Header;
